import React from 'react';

// == Style
import GTCStyled from './GTCStyled';

const GTC = () => {
  return (
    <GTCStyled>
      <h2 className="title">Conditions générales de vente et mentions légales</h2>
      <p className="sub-txt">Lorem ipsum dolor sit amet consectetur adipisicing elit. Laboriosam, aliquid!</p>
    </GTCStyled>
  );
};

export default GTC;
